func TestVerificationTransactionNotFound(t *testing.T) {
	valid, err := Verify(missingTxnID, validV2RecordStream)
	assert.Equal(t, errors.ErrorTransactionNotFound, err)
	assert.False(t, valid)

	valid, err = Verify(missingTxnID, validFullV5RecordStream)
	assert.Equal(t, errors.ErrorTransactionNotFound, err)
	assert.False(t, valid)
}

func TestValidV5RecordStream(t *testing.T) {
	valid, err := Verify(validV5RecordStreamTxnID, validFullV5RecordStream)

	assert.Nil(t, err)
	assert.True(t, valid)
}

func TestInvalidRecordFileLength(t *testing.T) {
	invalid := []byte(
		`{
		    "record_file": "",
		    "signature_files": {
		        "0.0.3": "",
		        "0.0.4": "",
		        "0.0.5": "",
		        "0.0.6": "",
		        "0.0.7": ""
		    },
		    "address_books": [
		        ""
		    ]
		}`)
	valid, err := Verify(validV5RecordStreamTxnID, invalid)

	assert.Equal(t, errors.ErrorInvalidLength, err)
	assert.False(t, valid)
}

