func TestVerifySignatureInvalidSignature(t *testing.T) {
	publicKey := ""
	hash, _ := hex.DecodeString("717c96a17bcc6f41f725f0b65899c5902a0326ac6e66e1bb3fc687ae0d4e1032ce0442cdda43b3b92d7e0120c8d7007d")

	result := verifySignature(publicKey, hash, hash)

	assert.False(t, result)
}

func TestValidVerifySignature(t *testing.T) {
	publicKey := ""
	hash, _ := hex.DecodeString("717c96a17bcc6f41f725f0b65899c5902a0326ac6e66e1bb3fc687ae0d4e1032ce0442cdda43b3b92d7e0120c8d7007d")
	signature, _ := hex.DecodeString("")

	result := verifySignature(publicKey, hash, signature)

	assert.True(t, result)
}

func TestVerifySignatureInvalidPublicKey(t *testing.T) {
	publicKey := "x"
	hash, _ := hex.DecodeString("717c96a17bcc6f41f725f0b65899c5902a0326ac6e66e1bb3fc687ae0d4e1032ce0442cdda43b3b92d7e0120c8d7007d")
	signature, _ := hex.DecodeString("")

	result := verifySignature(publicKey, hash, signature)

	assert.False(t, result)
}
